import React, { Component } from "react";
import axios from "axios";

class MostFQBenefits extends Component {
  constructor(props) {
    super(props);
    this.state = {
      facilities: [],
    };
  }

  componentDidMount() {
    this.fetchData();
  }

  fetchData = async () => {
    try {
      const response = await axios.get(
        "http://195.210.47.82:8000/facility/main/"
      );
      this.setState({ facilities: response.data });
      console.log(response.data); // Вывод данных в консоль браузера (для отладки)
    } catch (error) {
      console.error("Ошибка при получении данных:", error);
    }
  };

  render() {
    const { facilities } = this.state;

    return (
      <div>
        <h2>Facilities</h2>
        {facilities.map((facility) => (
          <div key={facility.id}>
            <h3>{facility.name}</h3>
            <ul>
              {facility.programs.map((program) => (
                <li key={program.id}>
                  <strong>Title:</strong> {program.title}
                  <br />
                  <strong>Description:</strong> {program.description}
                  <br />
                  <strong>Expired Date:</strong> {program.expired_date}
                  <br />
                  <strong>Cost:</strong> {program.cost}
                  <br />
                  {/* Дополнительные поля программы, если есть */}
                </li>
              ))}
            </ul>
          </div>
        ))}
      </div>
    );
  }
}

export default MostFQBenefits;
